Tape edition (The sound quality is not outstanding but totally satisfactory)

Author: Robert Mason

Narrator: L J Ganser

Length: 14.6 hrs


Chickenhawk is Robert Mason's narrative of his experiences as a UH-1 Iroquois helicopter pilot during the Vietnam War. The book chronicles his enlistment, flight training, deployment to and experiences in Vietnam, and his experiences after returning from the war.
